B.tR=new A.aY(38,{profileName:"Johnny Park",profileNameAlter:"\ubc15\uc11d\uc900 (Sukjun Park)",profilePosition:"Gameplay Programmer",profileEmail:"pos02232@gmail.com",introductionTitle:"\ud83d\udc4b Hello! I'm Johnny, a gameplay programmer.",introductionLine1:"I like to replace my mundane daily life with game development.",introductionLine2:"My life goal is to make a game that everyone has heard once about.",interestTitle:"\u2728 Interests",interest1:"Game Development",interest2:"Graphics Programming",skillLanguageTitle:"Languages",skillEngineTitle:"Game Engines / Frameworks",skillDevelopmentToolTitle:"Development Tools",skillGraphicsAPITitle:"Graphics API",educationTitle:"\ud83c\udf93 Education",educationSchool1:"DigiPen Institute of Technology",educationDegree1:u.a,educationSchool2:"Kyungpook National University",educationDegree2:"Master of Science in Computer Science",projectTitle:"\ud83c\udfae Projects",project1Title:"Return Alive",project1Subtitle:"Unreal 4.27, KOG, Dec.2021 \u2013 Nov.2024",project1Description:"**Language**: C++\n**Worked as**: Gameplay Programmer\n**Team members**: 30+\n\nAn extraction shooter game aimed at casual audiences. As a client programmer, I was responsible for developing the overall elements necessary for the play.\n\n- Developed 30+ diverse weapons and skills as per the game designer\u2019s request, aiding in the development of various combat situations.\n- Implemented and refined 30+ core game systems, including the trade market, world map and character states, contributing to a comprehensive gaming experience.\n- Introduced a particle rendering inspection procedure and render target optimization technique, boosting the average rendering performance by 20%.\n\n[Find details here!](https://returnalive.com/)",project2Title:"Bouncing Memory",project2Subtitle:"Custom C Engine, Sophomore project, Sept.2015 \u2013 July.2016",project2Description:"**Language**: C, GLSL\n**Worked as**: Tool Maker, Game Designer\n**Team members**: 6\n\nBuilt the level editor which let us design and implement levels in-game. I was also the game designer, so most of the time I used it for myself though. I was in charge of graphics pipeline (OpenGL) too.\n\n- Modeled in-game level editor with 50+ editable variables which simplified levelcreating steps and boosted level building time.\n- Designed 36 levels with 3 themed-episodes using engine\u2019s level editor.\n- Helped 3+ teammates formalize physics and engine structure, motivating team members and helping to improve their codes.\n\n[Try it here! (Windows only)](https://www.dropbox.com/s/2pjnjedq1ksud65/BouncingMemory_Setup_Final.exe?dl=0)",project3Title:"Trappist Landing",project3Subtitle:"Unity 2017, Senior project, Jan.2018 \u2013 April.2018",project3Description:"**Language**: C#, HLSL\n**Worked as**: Gameplay Programmer, Gameplay Designer\n**Team members**: 18\n\nDesigned each plants' interactions (puzzles) with other designers in the team. Implemented cinematic features which insured player can blend into the atmosphere. Also implemented cool arm UI!\n\n- Worked on implementing cinematic using Unity Cinemachine.\n- Constructed core gameplay mechanics and overall level designs.\n\n[Try it here! (Windows only)](http://games.digipen.edu/games/trappist-landing)",project4Title:"Latte Love",project4Subtitle:"Unity 5, Junior project, Sept.2016 \u2013 April.2017",project4Description:"**Language**: C#\n**Worked as**: Technical Director\n**Team members**: 8\n\nCompleted all the game logic requested by our designer in C# codes. Also collaborated with artists and sound designer to have their works successfully make it into the game.\n\n- Developed game in Unity Engine with 80+ gameplay mechanics in C# codes, successfully implementing all game logics introduced by game designer.\n- Clarified engine technical requirements to sound and art teammates resulting in fewer conflicts.\n- Fixed 120+ bugs from weekly playtest feedback and added scripts for game designer to easily tweak game difficulty which brought better game experience to players.\n\n[Watch video here!](https://vimeo.com/214277660?embedded=true&source=vimeo_logo&owner=65159572)",project5Title:"Minute Dive",project5Subtitle:"Unity 2017, Personal project, Nov.2018",project5Description:"**Language**: C#\n**Team members**: 2\n\nWorked on developing the entire build while my friend worked on graphic assets. This was done in a week, for a simple game jam that I planned with my friend.\n\n[Try it here! (Android only)](https://www.dropbox.com/s/ppbszc8hojmibuy/Minute%20Dive.apk?dl=0)",project6Title:"inZOI",project6Subtitle:"Unreal 5, inZOI Studio, 2024/12 - Present",project6Description:"**Language**: C++\n**Team members**: 100+\n\nA life simulation game with realistic graphics and detailed simulation. As a client programmer, I contributed to the development of game content, UI and more.\n\n[Find details here!](https://playinzoi.com/en)"},B.nF,t.li)
